import { faArrowRight, faEnvelope, faLock } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { FC } from 'react';
import loginPhoto from '../../images/login-photo.png';
import Button from '../Button/Button';

const Registration: FC = () => {
    const handleOnSubmit = () => {
        console.log('submit');
    }

    return (
        <div className='login-container'>
            <div className='login-container-left'>
                <img src={loginPhoto} />
            </div>
            <form method='POST' onSubmit={handleOnSubmit} className='login-container-right'>
                <h2>Registracija</h2>
                <div className='form-input-container'>
                    <input placeholder='El. Paštas' className='form-input'/>
                    <span className='form-input-icon'>
                        <FontAwesomeIcon icon={faEnvelope}/>
                    </span>
                </div>
                <div className='form-input-container'>
                    <input placeholder='Slaptažodis' className='form-input' type='password' />
                    <span className='form-input-icon'>
                        <FontAwesomeIcon icon={faLock}/>
                    </span>
                </div>
                <Button styling='form-button'>
                    Prisijungti
                </Button>

                <FormRedirectButton buttonText='Prisijungti' redirectUrl='/registration'/>
            </form>
        </div>
    );
}

export default Registration;
